    const size = {
        width: 121, 
        height: 81,
      };
  return (
    <>
      <div className="cartCard-container">
      <Image images={photo} className="images" size={size}></Image>
        <div className="cartCard-header">
          <p className="cartCart-tag">MY CART</p>
          <p className="wishlist-tag">MY WISHLIST</p>
        </div>
      </div>
    </>
  );
}
